import { BrowserRouter, Routes, Route } from "react-router-dom";

import Login from "./pages/Login";
import Welcome from "./pages/Welcome";

import PoolsList from "./pages/Pools/PoolsList";
import CreatePool from "./pages/Pools/CreatePool";
import EditPool from "./pages/Pools/EditPool";

import UsersList from "./pages/Users/UsersList";
import EditUser from "./pages/Users/EditUser";

import ProtectedRoute from "./components/ProtectedRoute";

export default function App() {
  return (
    <BrowserRouter>
      <Routes>

        <Route path="/" element={
          <ProtectedRoute>
            <Welcome />
          </ProtectedRoute>
        } />

        <Route path="/login" element={<Login />} />

        {/* Pools */}
        <Route path="/pools" element={
          <ProtectedRoute>
            <PoolsList />
          </ProtectedRoute>
        } />

        <Route path="/pools/create" element={
          <ProtectedRoute>
            <CreatePool />
          </ProtectedRoute>
        } />

        <Route path="/pools/edit/:id" element={
          <ProtectedRoute>
            <EditPool />
          </ProtectedRoute>
        } />

        {/* Users */}
        <Route path="/users" element={
          <ProtectedRoute>
            <UsersList />
          </ProtectedRoute>
        } />

        <Route path="/users/edit/:id" element={
          <ProtectedRoute>
            <EditUser />
          </ProtectedRoute>
        } />

      </Routes>
    </BrowserRouter>
  );
}
